import React, { useState } from 'react';

const GET_QUOTE = 'GET_QUOTE';

class AuthorQuoteKeyPair extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        count: 0
    }
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState({
      count: 0
    })
  }

  increment() {
    return count < 5 ? count++ : count - 5;
  }
  render() {
    return (
      <div>
        <h3>{this.count}</h3>
        <button onClick={this.handleClick}>NEXT</button>
      </div>
    );
  }
}
export default AuthorQuoteKeyPair;
